defs.script:
game={
  paused:1,
  rate:60,
  load:function(){
    game.event.add(game.get("inpt_play"),"mousedown",game.play);
    game.event.add(game.get("text_play"),"mousedown",game.play);
    game.event.add(game.get("inpt_reset"),"mousedown",game.reset);
    game.event.add(game.get("text_reset"),"mousedown",game.reset);
    for(i in game.parts){
      for(j in game.parts[i].els){
        if(game.get(game.parts[i].els[j])){
          game.event.add(game.get(game.parts[i].els[j]),"click",game.ch_color);
  }}}
  },
  interval:null,
  play:function(){
    game.paused=0;
    game.interval=setInterval("game.loop()",game.rate);
    game.event.add(game.get("inpt_pause"),"mousedown",game.pause);
    game.event.add(game.get("text_pause"),"mousedown",game.pause);
    game.event.add(document,"keyup",game.event.key);
    game.event.add(document,"keydown",game.event.key);
    game.event.add(document,"mouseup",game.event.mouse);
    game.event.add(document,"mousedown",game.event.mouse);
    game.get("char_scene").style.display="none";
    game.get("game_scene").style.display="inline";
  },
  pause:function(){
    clearInterval(game.interval);
    game.get("char_scene").style.display="inline";
    game.get("game_scene").style.display="none";
  },
  reset:function(){
    for(i in game.parts){
      game.ch_color({id:"_"+i},game.parts[i].reset_color)
    }
  },
  controls:{
    jump:[32,0,0],//space
    up:[87,38,0],//w and up arrow
    down:[83,40,0],//s and down arrow
    left:[65,37,0],//a and left arrow
    right:[68,39,0],//d and right arrow
  },
  event:{
    key:function(event){
      if(!game.paused){
      event.preventDefault();
      switch(event.keyCode) {
        case game.controls.jump[0]:
          switch(event.type) {
            case "keydown":
              if(!game.controls.jump[3]){
                //console.log("space down");
                game.controls.jump[3]=1;
              }
            break;
            case "keyup":
              //console.log("space up");
              game.controls.jump[3]=0;
            break;
          } 
        break;
        case game.controls.up[0]:
        case game.controls.up[1]:
          switch(event.type) {
            case "keydown":
              if(!game.controls.up[3]){
                //console.log("up down");
                game.controls.up[3]=1;
              }
            break;
            case "keyup":
              //console.log("up up");
              game.controls.up[3]=0;
            break;
          }
        break;
        case game.controls.down[0]:
        case game.controls.down[1]:
          switch(event.type) {
            case "keydown":
              if(!game.controls.down[3]){
                //console.log("down down");
                game.controls.down[3]=1;
              }
            break;
            case "keyup":
              //console.log("down up");
              game.controls.down[3]=0;
            break;
          }
        break;
        case game.controls.left[0]:
        case game.controls.left[1]:
          switch(event.type) {
            case "keydown":
              if(!game.controls.left[3]){
                //console.log("left down");
                game.player.key--;
                game.player.ori=-1;
                game.get("sprite").attributes["transform"].value="scale(-1 1)";
                game.controls.left[3]=1;  
              }            
            break;
            case "keyup":
              //console.log("left up");
              game.player.key++;
              game.controls.left[3]=0;
            break;
          }
        break;
        case game.controls.right[0]:
        case game.controls.right[1]:
          switch(event.type) {
            case "keydown":
              if(!game.controls.right[3]){
                //console.log("right down");
                game.player.key++;
                game.player.ori=1;
                game.get("sprite").attributes["transform"].value="scale(1 1)";
                game.controls.right[3]=1;  
              }         
            break;
            case "keyup":
              //console.log("right up");
              game.player.key--;
              game.controls.right[3]=0;
            break;
          }
        break;
      }}  
    },
    mouse:function(event){
      if(!game.paused){
      document.oncontextmenu=function(){return false};
      switch(event.button) {
        case 0:
          switch(event.type) {
            case "mousedown":
              //console.log("first down");
            break;
            case "mouseup":
              //console.log("first up");
            break;
          }
        break;
        case 1:
          switch(event.type) {
            case "mousedown":
              //console.log("sec down");
            break;
            case "mouseup":
              //console.log("sec up");
            break;
          }
        break;
        case 2:
          switch(event.type) {
            case "mousedown":
              //console.log("third down");
            break;
            case "mouseup":
              //console.log("third up");
            break;
          }
        break;
      }}
    },
    add:function add(el,type,funct){
      if (el.addEventListener){
        el.addEventListener(type, funct, false);
      }else if (el.attachEvent){
        el.attachEvent("on"+type, funct);
      }
    }
  },
  player:{
    position:[200,100],
    acc:2,
    maxsp:10,
    speed:0,
    key:0,
    ori:1,
    move:function(){
      var x=0,y=1;
      if(game.player.key==0){
        if(game.player.speed<0){game.player.speed += game.player.acc}
        if(game.player.speed>0){game.player.speed -= game.player.acc}
      }else{
        if(game.player.ori==1 && game.player.speed<game.player.maxsp){game.player.speed += game.player.acc}
        if(game.player.ori==-1 && game.player.speed>game.player.maxsp*-1){game.player.speed -= game.player.acc}
      }
      game.player.position[x] += game.player.speed;
      game.get("player").attributes["x"].value = game.player.position[x];
    }
  },
  sprite:{
    frame:0,
    size:50,
    walkseq:[[0,-4],[-1,-4],[-2,-4],[-3,-4],[-4,-4],[-3,-4],[0,-5],[-1,-5],[-2,-5],[-3,-5],[-4,-5],[-3,-5]],
    stand:[-7,0],
    anime:function(){
      var x=0,y=1,corr=0;
      if(game.player.ori== -1){corr=-50}else{corr=0}
      if((game.player.key==0)&&(game.sprite.frame==0||game.sprite.frame==6)){
        game.sprite.frame=0;
        var spx=(game.sprite.stand[x]*game.sprite.size)+corr;
        var spy=game.sprite.stand[y]*game.sprite.size;
      }else{
        var spx=(game.sprite.walkseq[game.sprite.frame][x]*game.sprite.size)+corr;
        var spy=game.sprite.walkseq[game.sprite.frame][y]*game.sprite.size;
        if(game.sprite.frame<game.sprite.walkseq.length-1){
          game.sprite.frame++
        }else{game.sprite.frame=0} 
      }         
      game.get("sprite").attributes["x"].value = spx;
      game.get("sprite").attributes["y"].value = spy;
    }
  },
  loop:function(){ 
    if(!game.paused){
    game.player.move();
    game.sprite.anime();
  }},
  get:function(id){
    if(document.getElementById(id)){
      return document.getElementById(id)
    }else{
      return document.getElementsByClassName(id)
    }
  },
  log: function(obj){
    for(i in obj){console.log(i+" = "+obj[i])}
  },
  colors:{
    blue:["6abfe7","3a84c3","3c539c"],
    cyan:["bce3ea","95d0dd","5f9cc2"],
    green:["aae46c","40d717","259420"],
    greenYellow:["cdf16d","aae56c","8ac42e"],
    yellow:["fff197","eaed11","b7b125"],
    orange:["edcf95","f4b233","cd9269"],
    red:["efb6a2","ec522c","9c2e2e"],
    skin:["ffefef", "fcdcbb", "efb293"],
    darkskin:["f8d5bd", "f8b080", "d07048"],
    brown:["dcbc9b", "cf9273", "9f6243"],
    pink:["ffbafe", "f99afa", "f38bbf"],
    purple:["e66ce4","c43aaf","9c4070"],
    black:["b1b1b1","616161","313131"],
    grey:["d2d2d2","a2a2a2","626262"],
    white:["f3f3f3","d3d3d3","b3b3b3"]
  },
  parts:{
    face:{
      reset_color: 7,
      color: 7,
      els:["inpt-bt_face","part_face","part-right_face","part-left_face"]
    },
    eye:{
      reset_color: 0,
      color: 0,
      els:["inpt-bt_eye","part-mid-right_eye","part-mid-left_eye"]
    },
    helmet:{
      reset_color: 0,
      color: 0,
      els:["inpt-bt_helmet","part_helmet"]
    },
    hsec:{
      reset_color: 1,
      color: 1,
      els:["inpt-bt_hsec","part-1_hsec","part-2_hsec","part-3_hsec","part-4_hsec","part-5_hsec","part-6_hsec","part-7_hsec"]
    },
    hand:{
      reset_color: 0,
      color: 0,
      els:["inpt-bt_hand","part-weapon_hand","part-1-weapon_hand","part-2-weapon_hand","part-3-weapon_hand","part-1_hand","part-2_hand","part-3_hand"]
    },
    core:{
      reset_color: 6,
      color: 6,
      els:["inpt-bt_core","part-1_core","part-2_core","part-4_core","part-5_core"]
    },
    shirt:{
      reset_color: 1,
      color: 1,
      els:["inpt-bt_shirt","part_shirt"]
    },
    pants:{
      reset_color: 0,
      color: 0,
      els:["inpt-bt_pants","part_pants"]
    },
    leg:{
      reset_color: 1,
      color: 1,
      els:["inpt-bt_leg","part-left_leg","part-right_leg"]
    },
    boot:{
      reset_color: 0,
      color: 0,
      els:["inpt-bt_boot","part-left_boot","part-fx-left_boot","part-right_boot","part-fx-right_boot"]
    }
  },
  str:{
    part:function(id){
      var str=id.slice(id.search('_')+1,id.length);
      return str
    },
    grad:function(id){
      var str=id.slice(id.search('#')+1, id.length-1 );
      return str
    }
  },
  ch_color:function(event,color_id){
    if(event.srcElement){
    var el=event.srcElement;
    }else if(event.target){var el=event.target;
    }else{var el=event}
    var part_str=game.str.part(el.id);
    var color=game.parts[part_str].color;
    var colors=game.colors;
    var names=[];
    for(i in colors){names.push(i)}
    var ncolor;
    if(color_id!=null){ncolor=color_id}
    else if(color>=names.length-1){ncolor=0}else{ncolor=color+1}
    game.parts[part_str].color=ncolor;
    var elarr=game.get('paint');
    for(h in elarr){
      if(elarr[h].id){
      var el_str=game.str.part(elarr[h].id);
      if(el_str==part_str){
      var cel=elarr[h];
      if(cel.attributes['stroke']){
        for(j in colors[names[color]]){          
        var st=cel.attributes['stroke'].value;
        if(st=="#"+colors[names[color]][j]){
          cel.attributes['stroke'].value="#"+colors[names[ncolor]][j];   
      }}}
      if(cel.attributes['fill']){
        var grad_str=game.str.grad(cel.attributes['fill'].value);
        if(!game.get(grad_str).id){
          for(j in colors[names[color]]){
            var fi=cel.attributes['fill'].value;
            if(fi=="#"+colors[names[color]][j]){
              cel.attributes['fill'].value="#"+colors[names[ncolor]][j];
      }}}else{
        var g=game.get(grad_str);
        var ch=g.childNodes;
        for (i in ch){
          if(ch[i].attributes){
            var st=ch[i].attributes['stop-color'].value;
            for(j in colors[names[color]]){
              if(st=="#"+colors[names[color]][j]){
                ch[i].attributes['stop-color'].value="#"+colors[names[ncolor]][j];
    }}}}}}}}}}
}
game.event.add(window,"load",game.load)
